import {Component} from 'react'
import Link from 'next/link'

export default class Contact extends Component{

	render()
	{
	
		return(
				<div> 
					<h1> Contact Component or Component with Class</h1>
					
		             <Link href="./index"> Go Back To Index Page </Link>

	            </div>
			)
	}
}
